import React from "react";
import Header from "./Header/Header";

import Footer from "./Footer/footer";

const Shop = () => {
  return (
    <>
      <Header />
      <section className="shop">
        <h2>Shop</h2>
      </section>
      <Footer />
    </>
  );
};

export default Shop;
